Jonathan Messer (Ewan McGregor) heeft geen sociaal leven en alles gaat dan ook om zijn werk. Dan ontmoet hij tijdens een nieuwe 
klus Wyatt Bose (Hugh Jackman). Die introduceert hem in een hele andere wereld. Maar nog voordat Jonathan beseft wat hem 
overkomt, is hij hoofdverdachte in een ontvoeringszaak en een miljoenendiefstal.
